import React, { Component, useState, useRef } from 'react';
import { Container, Row, Col, Form, Input, Label } from 'reactstrap';

import FeatherIcon from 'feather-icons-react';

const NewsLetterSub = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        'service_8dmdsi7',
        'template_th7bztm',
        form.current,
        'WJW0NM0MduGhIRYE8',
      )
      .then(
        (result) => {
          setEmail('');
          setsucceMsg(true);
        },
        (error) => {
          console.log(error.text);
          alert('FAILED...', error);
        },
      );
  };

  const [name, setName] = useState();
  const [email, setEmail] = useState();
  const [phone, setPhone] = useState();
  const [company, setCompany] = useState();
  const [time, setTime] = useState();
  const [show, setShow] = useState(false);
  return (
    <React.Fragment>
      <form>
        <Row>
          <Col lg={12}>
            <div className={'foot-subscribe mb-3 foot-white'}>
              <Label
                className={
                  this.props.isLight ? 'form-label text-muted' : 'form-label'
                }
              >
                Write your email <span className="text-danger">*</span>
              </Label>
              <div className="form-icon position-relative">
                <FeatherIcon icon="mail" className="fea icon-sm icons" />
                <Input
                  type="email"
                  name="email"
                  id="emailsubscribe"
                  className={
                    this.props.isLight
                      ? 'form-control ps-5 rounded bg-light border'
                      : 'form-control ps-5 rounded'
                  }
                  placeholder="Your email : "
                  required
                />
              </div>
            </div>
          </Col>
          <Col lg={12}>
            <div className="d-grid">
              <input
                type="submit"
                id="submitsubscribe"
                name="send"
                className={
                  this.props.isLight
                    ? 'btn btn-primary'
                    : 'btn btn-soft-primary'
                }
                value="Subscribe"
              />
            </div>
          </Col>
        </Row>
      </form>
    </React.Fragment>
  );
};

export default NewsLetterSub;
